<!DOCTYPE html>
<html lang="en">
  <head>
    <style>
      body {
        font-size: 11px;
        font-family: Lato,sans-serif;
      }

      td,
      th {
        padding: 2px 4px;
        text-align: left;
        vertical-align: top;
      }

      h1 {
        margin-bottom: 0;
      }

      h3 {
        border: 1px solid black;
        padding: 2px 4px;
      }

      p {
        font-family: serif;
      }

      table {
        font-size: 11px;
        border-collapse: collapse;
        border-spacing: none;
        width: 100%;
      }

      .bordered-bottom {
        border-bottom: solid 1px black;
      }
      .bordered-top {
        border-top: solid 1px black;
      }
      .col-min {
        width: 1%;
      }

      .float-right {
        float: right;
      }

      .stretch {
        width: 100%;
      }

      .text-blue {
        color: blue;
      }
      .text-center {
        text-align: center;
      }
      .text-em {
        font-style: italic;
      }
      .text-nowrap {
        white-space: nowrap;
      }
      .text-red {
        color: red;
      }
      .text-right {
        text-align: right;
      }
      .text-large {
        font-size: 14px;
      }
      .text-small {
        font-size: 8px;
      }
      .text-strong {
        font-weight: bold;
      }

      #sw_logo {
        height: 80px;
      }

      #wrapper {
        max-width: 1000px;
        width: 100%;
        margin: 0 auto;
      }
    </style>
  </head>
  <body>
    <div id="wrapper">
      <table>
        <tbody>
          <tr>
            <td>
              <img id="sw_logo" src="data:image/png;base64,">
            </td>
            <th class="text-right" nowrap>
              9380 198th Street, Langley, BC VIM 3C8<br>
              Tel: 604-882-6855 Fax: 604-882-6890<br>
              Website: www.starlinewindows.com
            </th>
          </tr>
        </tbody>
      </table>
    </div>
  </body>
</html>
